class MarkerDetailsModel {
  MarkerDetailsModel({
      String? formattedAddress, 
      String? name, 
      List<Photos>? photos, 
      num? rating, 
      List<Reviews>? reviews,}){
    _formattedAddress = formattedAddress;
    _name = name;
    _photos = photos;
    _rating = rating;
    _reviews = reviews;
}

  MarkerDetailsModel.fromJson(dynamic json) {
    _formattedAddress = json['formatted_address'];
    _name = json['name'];
    if (json['photos'] != null) {
      _photos = [];
      json['photos'].forEach((v) {
        _photos?.add(Photos.fromJson(v));
      });
    }
    _rating = json['rating'];
    if (json['reviews'] != null) {
      _reviews = [];
      json['reviews'].forEach((v) {
        _reviews?.add(Reviews.fromJson(v));
      });
    }
  }
  String? _formattedAddress;
  String? _name;
  List<Photos>? _photos;
  num? _rating;
  List<Reviews>? _reviews;
MarkerDetailsModel copyWith({  String? formattedAddress,
  String? name,
  List<Photos>? photos,
  num? rating,
  List<Reviews>? reviews,
}) => MarkerDetailsModel(  formattedAddress: formattedAddress ?? _formattedAddress,
  name: name ?? _name,
  photos: photos ?? _photos,
  rating: rating ?? _rating,
  reviews: reviews ?? _reviews,
);
  String? get formattedAddress => _formattedAddress;
  String? get name => _name;
  List<Photos>? get photos => _photos;
  num? get rating => _rating;
  List<Reviews>? get reviews => _reviews;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['formatted_address'] = _formattedAddress;
    map['name'] = _name;
    if (_photos != null) {
      map['photos'] = _photos?.map((v) => v.toJson()).toList();
    }
    map['rating'] = _rating;
    if (_reviews != null) {
      map['reviews'] = _reviews?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

